	copyItem: function () {
		copy_count = 1;
		copy_item_page_index = MakeStore.getPageIndex();

		var item = MakeStore.getItem().clone(),
			_items_clone = [item];
		if (item.get("group_id")) {
			var _items = MakeStore.getItems();
			for (var i = 0, j = 0; i < _items.length; i++) {
				console.log("group_id", _items[i].attributes.group_id);
				if (_items[i].attributes.group_id == item.get("group_id") && _items[i].attributes.item_type == 17) {
					_items_clone.push(_items[i].clone());
				}
			}
		}
		Clipboard.push(_items_clone);
	},

	pasteItem: function () {
		var obj = Clipboard.pull();
		if (MakeStore.getPageIndex() == copy_item_page_index) {
			copy_count++;
			for (var i = 0, j = 0; i < obj.length; i++) {
				if (obj[i].get("item_type") != 17) {
					obj[i].set("item_left", (obj[i].get("item_left") + copy_count * 10));
					obj[i].set("item_top", (obj[i].get("item_top") + copy_count * 10));
				}
				if (obj[i].get("group_id")) {
					obj[i].set("group_id", MakeStore.getItems().length);
				}
				obj[i].set("item_layer", MakeStore.getItems().length + j);
				j++;
			}
		}
		MakeStore.appendItems(obj);
	},
	deleteItem: function(index){
		var _index = (!!index)?index:itemIndex,item_obj = pageObjs[pageIndex]["attributes"]["item_object"], groupID = item_obj[_index].get("group_id");
		item_obj.splice(_index,1);
		if( !!groupID ){
			for( var i = 0; i < item_obj.length; i++){
				if( item_obj[i].get("group_id") == groupID ){
					item_obj.splice(i,1);
				}
			}
		}
		itemIndex = -1;
		this.emitItemChange();
		this.emitPageChange();
	},

