	/*
	*  items 
	*/
    filterItems: function(tplData){
        var _pages = tplData.get("pages");
        var ilen = _pages.length;
        for( var i = 0 ; i < ilen ; i++ ){
            _itemObj = _pages[i].get("item_object"),jlen = _itemObj.length;
            for( var j = 0 ; j < jlen ; j++){
            	var l = _itemObj[j].get("item_left"), t = _itemObj[j].get("item_top"), x = _itemObj[j].get("x_scale"), y = _itemObj[j].get("y_scale"), w = _itemObj[j].get("item_width"), h = _itemObj[j].get("item_height");
	            if(_itemObj[j].get("fix_attr")){
	            	var fixAttrVal = {}
			        var fixAttr = (_itemObj[j].get("fix_attr"))+"".replace(/{}/g,"");
			        fixAttrVal = eval('('+fixAttr+')');
			        w = fixAttrVal.itemWidth||w;
			        h = fixAttrVal.itemHeight||h;
			    }
                var itemLeft = l - (w * x - w) / 2;
                var itemTop = t - (h * y - h) / 2;
                if(_itemObj[j].get("item_type") == 2){
                	_itemObj[j].set("item_val", _itemObj[j].get("item_val").replace(/<div><\/div>/g, "\n").replace(/<div>/g, "\n").replace(/<\/div>/g, "").replace(/<br>/g, "").replace(/&nbsp;/g, " "));
                }
                if(_itemObj[j].get("item_type") != 2){
	                _itemObj[j].set("item_width", _itemObj[j].get("item_width") * _itemObj[j].get("x_scale"));
	                _itemObj[j].set("item_height", _itemObj[j].get("item_height") * _itemObj[j].get("y_scale"));
	                _itemObj[j].set("x_scale", 1);
	                _itemObj[j].set("y_scale", 1);
	            }
	            if(_itemObj[j].get("item_type") == 19){
	            	_itemObj[j].set("item_type", 3);
	            }
            }
            this.filterItemsType_18(_itemObj);
	        _itemObj.sort(this.filterItemsSort);
        }
    },
    filterItemsSort: function(a,b){
    	return a.attributes.item_layer - b.attributes.item_layer
    },
    filterJsonItemsType_not_2: function(items){
    	var _itemObj = items , len = _itemObj.length;
    	for( var j = 0 ; j < len ; j++ ){
            if(_itemObj[j].item_type != 2){
	            _itemObj[j].item_width = _itemObj[j].item_width * _itemObj[j].x_scale;
                _itemObj[j].item_height = _itemObj[j].item_height * _itemObj[j].y_scale;
                _itemObj[j].x_scale = 1;
                _itemObj[j].y_scale = 1;
            }
    	}
    },
    filterJsonItemsType_2_div: function(items){
		var _itemObj = items , len = _itemObj.length;
    	for( var j = 0 ; j < len ; j++ ){
            if(_itemObj[j].item_type == 2){
				_itemObj[j].item_val = _itemObj[j].item_val.replace(/<div><\/div>/g, "\n").replace(/<div>/g, "\n").replace(/<\/div>/g, "").replace(/<br>/g, "").replace(/&nbsp;/g, " ");
			}
    	}
    },
    filterItemsType_18: function(items){
    	var _itemObj = items , len = _itemObj.length;
    	for( var j = 0 ; j < len ; j++ ){
            if(_itemObj[j].get("item_type") == 18){
            	for(var l = 0; l < len ; l++){
            		if(_itemObj[l].get("item_type") == 17 && _itemObj[l].get("group_id") == _itemObj[j].get("group_id")){
		                _itemObj[l].set("item_width", _itemObj[j].get("item_width"));
		                _itemObj[l].set("item_height", _itemObj[j].get("item_height"));
		            	_itemObj[l].set("item_top", _itemObj[j].get("item_top"));
		            	_itemObj[l].set("item_left", _itemObj[j].get("item_left"));
            		}
            	}
            	_itemObj[j].set("item_type", 1);
            	_itemObj[j].set("item_top", 0);
            	_itemObj[j].set("item_left", 0);
            }
			if( _itemObj[j].get("item_type") == 1 && !!_itemObj[j].get("group_id") ){
				for(var l = 0; l < len ; l++){
					if(_itemObj[l].get("item_type") == 17 && _itemObj[l].get("group_id") == _itemObj[j].get("group_id")){
						_itemObj[l].set("item_width", _itemObj[j].get("item_width"));
						_itemObj[l].set("item_height", _itemObj[j].get("item_height"));
						_itemObj[l].set("item_top", _itemObj[l].get("item_top") + _itemObj[j].get("item_top"));
						_itemObj[l].set("item_left", _itemObj[l].get("item_left") + _itemObj[j].get("item_left"));
					}
				}
				_itemObj[j].set("item_top", 0);
				_itemObj[j].set("item_left", 0);
			}
    	}
    },
